import React from 'react';

function UseStateObject(){
    const myObj = {
        name:'jack',
        height:6.5,
        age:25,
        isYoung:true
    }
    return(
        <>
        <h1>useState with Object</h1>
        <h2>Name:{myObj.name}</h2>
        <h2>Height:{myObj.height}</h2>
        <h2>Age:{myObj.age}</h2>
        <h2>{myObj.isYoung}</h2>

        </>
    )
}
export default UseStateObject;
